 Meet another cheater. Her name is Melissa May, and like all cheaters, she's crafty. For example, she'll swear up and down with absolute conviction that it's a &quot;girls' day shopping at the mall&quot;, when, in fact, she's on her way to a notorious adult bookstore. It's all over the net that foul things go down in their private viewing booths, and would not you know it? After a quick trip through the store, Melissa's got a DVD in hand, and her own booth secure for the next 1/2 hour. It's only a matter of minutes before the creeps know she's in there, and then it's on! This time barely-legal shit
